        </div>
      <div className="container-fluid mt-2 f">
       
        <div className="row row-cols-1 row-cols-md-5 mx-2 g-4">
          {filterCourtsByGroup().map((court) => (
            <div key={court._id} className="col">
              <Cards court={court} />
            </div>
          ))}
        </div>
      </div>
    </div>
  )
}

export default members
